def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.select_dtypes(include=[np.number], copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for block in data.blocks:
        # Handle aggregation based on the condition
        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except NotImplementedError:
            # Handle condition not implemented errors
            if alt is None:
                assert how == "ohlc"
                # Exclude the block if alternative method is not available
                continue
            else:
                # Handle alternative aggregation method
                result = block.apply(alt, axis=self.axis)

        # Ensure result is not a DataFrame
        assert not isinstance(result, pd.DataFrame)

        # Validate and store the aggregated result
        agg_block: Block = block.make_block(result)
        agg_blocks.append(agg_block)

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    # Perform necessary adjustments

    return agg_blocks, data.items
